import React, { useState } from "react";
import "./App.css";
function App() {
  const [isLoggedIn, setIsLoggerIn] = useState(false);

  return (
    <div>
      <h1>Smileys</h1>
      <div className="loginControl">
        <button>Login</button>
        <button>Logout</button>
      </div>
      {String(isLoggedIn)}
    </div>
  );
}
export default App;
